export default (function(a,b,c,d,e,f,g,h,i){return {data:{"9EdY7FwJjp":{data:[{id:2745,attributes:{type:f,item_lang:{data:{id:3412,attributes:{title:"House of the Dragon",slug:"house-of-the-dragon"}}}}},{id:2747,attributes:{type:b,item_lang:{data:{id:3414,attributes:{title:"Bullet Train",slug:"bullet-train"}}}}},{id:2752,attributes:{type:b,item_lang:{data:{id:3419,attributes:{title:"White Noise",slug:"white-noise"}}}}},{id:2765,attributes:{type:b,item_lang:{data:{id:3432,attributes:{title:"Argylle",slug:"argylle"}}}}},{id:2772,attributes:{type:f,item_lang:{data:{id:3439,attributes:{title:"Super Pumped",slug:"super-pumped"}}}}}],meta:{pagination:{page:g,pageSize:25,pageCount:g,total:5}}},x5e6qlhLAX:{data:{id:1965,attributes:{imdbId:"tt3661394",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BZWY3OTNhNWUtMDk2My00ZGVhLWE5ODQtM2NkOTZiMWM2MGY2XkEyXkFqcGdeQXVyNjMwMzc3MjE@._V1_SX300.jpg",type:b,ratings:[{Source:"Internet Movie Database",Value:"6.6\u002F10"},{Source:"Rotten Tomatoes",Value:"71%"},{Source:"Metacritic",Value:"58\u002F100"}],item_lang:{data:{id:2628,attributes:{title:h,plot:"A gorilla named Ivan tries to piece together his past with the help of an elephant named Ruby as they hatch a plan to escape from captivity.",slug:"the-one-and-only-ivan"}}},books:{data:[{id:9866,attributes:{title:h,description:"Bestselling author Applegate presents an unforgettable and uplifting tween animal fantasy that explores the power of friendship, art, and hope with humor and touching poignancy. Illustrations.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=LjCLrgEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[a],firstBook:true,published:"2012-01-01",publisher:"HarperCollins Children's Books",subtitle:e}},{id:9867,attributes:{title:"The One and Only Ivan Movie Tie-In Edition",description:"The #1 New York Times bestselling and Newbery Award-winning novel The One and Only Ivan is coming to Disney+ this summer, with a star-studded cast including Sam Rockwell, Angelina Jolie, Danny DeVito, Helen Mirren, Bryan Cranston, and more! This movie tie-in hardcover edition features full-color images from the film, quotes from the stars, and new cover art. This unforgettable novel from renowned author Katherine Applegate celebrates the transformative power of unexpected friendship. Inspired by the true story of a captive gorilla known as Ivan, this illustrated book is told from the point of view of Ivan himself. Ivan is an easy-going gorilla. Living at the Exit 8 Big Top Mall and Video Arcade, he has grown accustomed to humans watching him through the glass walls of his domain. He rarely misses his life in the jungle. Mostly, he thinks about art. Then he meets Ruby, a baby elephant taken from her family, and she makes Ivan see their home--and his own art--through new eyes. When Ruby arrives, change comes with her, and it's up to Ivan to make it a change for the better. The One and Only Ivan was hailed as a best book of the year by Kirkus, School Library Journal, and Amazon and earned four starred reviews. In the tradition of timeless stories like Charlotte's Web and Stuart Little, Katherine Applegate blends humor and poignancy to create Ivan's unforgettable first-person narration in a story of friendship, art, and hope. An author's note depicts the differences between the fictional story and true events. And don't miss the sequel to this beloved modern classic--The One and Only Bob! --Kathi Appelt, Newbery Honor author of The Underneath",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=zZnxygEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[a],firstBook:c,published:"2020-07-07",publisher:d,subtitle:i}},{id:9868,attributes:{title:"The One and Only Ivan: A Harper Classic",description:"Soon to be a major motion picture! This Harper Classic edition of the Newbery Medal winner and #1 New York Times bestseller includes an author's note, a letter from the real Ivan's caretaker at Zoo Atlanta, Ivan's \"signature,\" discussion questions, and more. This unforgettable novel from renowned author Katherine Applegate celebrates the transformative power of unexpected friendship. Inspired by the true story of a captive gorilla known as Ivan, this illustrated book is told from the point of view of Ivan himself. Having spent twenty-seven years behind the glass walls of his enclosure in a shopping mall, Ivan has grown accustomed to humans watching him. He hardly ever thinks about his life in the jungle. Instead, Ivan occupies himself with television, his friends Stella and Bob, and painting. But when he meets Ruby, a baby elephant taken from the wild, he is forced to see their home, and his art, through new eyes. In the tradition of timeless classics such as Charlotte's Web and Stuart Little. Katherine Applegate's novel blends humor and poignancy to create this incredible tale of friendship, art, and hope. The One and Only Ivan was named to multiple state lists, received three starred reviews, and was hailed as a best book of the year by Kirkus, School Library Journal, and Amazon. Plus don't miss Katherine Applegate's Endling series!",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=t_eRvgEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[a],firstBook:c,published:"2017-10-24",publisher:d,subtitle:e}},{id:9869,attributes:{title:"The One and Only Ivan Full-Color Collector's Edition",description:"The One and Only Ivan is a Newbery Medal winner and a #1 New York Times bestseller! This large-format collector's edition includes full-color interior artwork from illustrator Patricia Castelao, a special letter from Katherine Applegate, her Newbery Medal acceptance speech, a letter from Ivan's caretaker at Zoo Atlanta, Ivan's signature, and sketches and illustrations that were not part of the original book. Inspired by the true story of a captive silverback gorilla known as Ivan, this stirring and unforgettable novel celebrates the transformative power of unexpected friendships. Having spent twenty-seven years behind the glass walls of his enclosure in a shopping mall, Ivan has grown accustomed to humans watching him. He hardly ever thinks about his life in the jungle. Instead, Ivan occupies himself with television, his friends Stella and Bob, and painting. But when he meets Ruby, a baby elephant taken from the wild, he is forced to see their home, and his art, through new eyes. Hailed as a best book of the year by Kirkus, School Library Journal, and Amazon, Katherine Applegate's novel blends humor and poignancy to create this incredible tale of friendship, art, and hope told from Ivan's own point of view, in the tradition of timeless classics such as Charlotte's Web and Stuart Little. Correlates to the Common Core State Standards in English Language Arts",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=rTNXrgEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[a],firstBook:c,published:"2015-11-03",publisher:d,subtitle:i}},{id:9870,attributes:{title:"The One and Only Bob",description:"A #1 New York Times bestseller! \"Good dog Bob. Great to have a best friend.”—Danny DeVito Return to the unforgettable world of the Newbery Medal-winning and #1 New York Times bestselling novel The One and Only Ivan (soon to be a major motion picture!) in this incredible sequel, starring Ivan’s friend Bob! Bob sets out on a dangerous journey in search of his long-lost sister with the help of his two best friends, Ivan and Ruby. As a hurricane approaches and time is running out, Bob finds courage he never knew he had and learns the true meaning of friendship and family. Bob, Ivan, and Ruby have touched the hearts of millions of readers, and their story isn’t over yet. Catch up with these beloved friends before the star-studded film adaptation of The One and Only Ivan hits theaters in August 2020! One and Only Bob is an instant #1 New York Times bestseller, embraced by new and old fans of Katherine Applegate's beloved One and Only Ivan. Great for summer reading or anytime! A Today show pick for “25 children’s books your kids and teens won’t be able to put down this summer!\"",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=xju2DwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:c,published:"2020-05-05",publisher:d,subtitle:e}}]}}},meta:{}}},prerenderedAt:1681703523968}}("Katherine Applegate","movie",null,"HarperCollins","","series",1,"The One and Only Ivan","My Story"))